import React, { Fragment } from 'react';

import { parseDate } from '../../utils/parseDate';
import { getThumbnail } from '../../utils/getThumbnail';

const Post = ({ post, unread }) => {
  return (
    <Fragment>
      <div>
        {
          unread ? "unread" : "read"
        }
      </div>
      <div>
        title:
        {post.title}
      </div>
      <div>
        author:
        {post.author}
      </div>
      <div>
        time:
        {parseDate(post.created_utc)}
      </div>
      <div>
        Thumbnail: 
        {getThumbnail(post.thumbnail)}
      </div>
      <div>
        Comments: 
        {post.num_comments}
      </div>
    </Fragment>
  )
}

export default Post;
